import React, { Component } from 'react';




const list = [
  {
    "id":1,
    "title":"1st todo",
    "body":"Learn Django properly."
    },
    {
    "id":2,
    "title":"Second item",
    "body":"Learn Python."
    },
    {
    "id":3,
    "title":"Learn HTTP",
    "body":"It's important."
    }

]




class App extends Component {

  constructor(props) {
    super(props);
    this.state = {
      list
    }
  }




}
